Defendant Latoya N Jennings in court with Attorney Jeff Allen Schwarz.  David Robles appeared for the State of Wisconsin.

Matter here for sentencing.  Sentencing proceeded.  Statements by the State, defense and defendant.  AS TO COUNT #1:  The Court imposed the following sentence:  The Defendant's TOTAL LENGTH OF SENTENCE shall be FOUR (4) years.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for TWO (2) years with credit for FIVE (5) days time served.  Defendant shall serve TWO (2) years on EXTENDED SUPERVISION.  The Court STAYS sentence and orders PROBATION for THREE (3) years.

AS TO COUNT #2:  The Court imposed the following sentence:  The Defendant's TOTAL LENGTH OF SENTENCE shall be FOUR (4) years CONSECUTIVE to count #1.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for TWO (2) years.  Defendant shall serve TWO (2) years on EXTENDED SUPERVISION.  The Court STAYS sentence and orders PROBATION for THREE (3) years CONCURRENT to count #1.

The defendant is not eligible for the Challenge Incarceration Program;
The defendant is not eligible for the Wisconsin Substance Abuse Program.  

The Court advised the defendant of the determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. 

Court advised defendant that as a convicted felon she may never possess any gun or other firearms. 
Court advised defendant that her voting rights are suspended, and may not vote in any election until her civil rights are restored.  

CONDITIONS OF EXTENDED SUPERVISION/PROBATION:
 - No contact with co-actors, Curtis Caffey, Jameerah Morgan and Bradley Wallace;
 - Advise any potential employer of your conviction;
 - One year at HOC--STRAIGHT TIME--STAYED;
 - Seek and maintain employment;
 - Restitution in the amount of $31,689.42--$10,645.31 to BMO Bank; $4,678.45 to Associated Bank; $6,413.19 to Capitol CU; $2,850.00 to Baylake; $2,803.80 to Bank Mutual; $3,205.60 to TCF Bank; and $1,093.07 to Johnson Bank.  This is to be paid BEFORE any costs or surcharges are paid;
 - Defendant has to have a $2,000 payment in by May 2, 2016.  The Defendant has to pay $500 a month starting on June 1, 2016 and each month following until restitution is paid;  If no payments are made, Defendant will be taken into custody;
 - Pay the DNA surcharge, costs and disbursements by the end of probationary period.  Failure to pay amounts in full would result in a civil judgment entered against defendant.

